import { useState } from 'react';
import './App.css';

function extract(url){
  console.log(url);
  url_calling(url);
}
function url_calling(url){
  fetch(url,
    {headers:{
      'Access-Control-Allow-Origin':'no-cors'
    }}).then(response=> response.body).then(data => console.log(data));
}
function App() {
  const [url,setUrl] = useState('');
  const handleChange = event => {
    setUrl(event.target.value);
    console.log(event.target.value);
  }
  return (
    <div className="App">
      <header className="App-header">
       <h1>Wiki Seeker</h1>>
      </header>
    </div>
  );
}

export default App;
